  <body>
    <div id="base" class="">

      <!-- Unnamed (新母版 1) -->

      <!-- Unnamed (图片) -->
      <div id="u1" class="ax_图片">
        <img id="u1_img" class="img " src="images/app/u1.jpg"/>

        <div id="u2" class="text"></div>
      </div>

      <div id="u3" class="ax_图片">

        <div id="u4" class="text"></div>
      </div>

      <!-- 搜索输入框热区 (Hot Spot) -->
      <div id="u5" class="ax_hot_spot" data-label="搜索输入框热区">

      <div id="u6" class="ax_图片" data-label="空白搜索条">

      <div id="u8" class="ax_垂直线" data-label="光标">

        <div id="u10" class="text"></div>
      </div>

      <div id="u11" class="ax_hot_spot" data-label="J">
      </div>

      <!-- Y (Hot Spot) -->
      <div id="u12" class="ax_hot_spot" data-label="Y">
      </div>

      <!-- Unnamed (Hot Spot) -->
      <div id="u13" class="ax_hot_spot">
      </div>

        <img id="u14_img" class="img " src="resources/images/transparent.gif"/>

        <div id="u15" class="text">
          <p><span>简</span></p>
        </div>
      </div>

      <!-- 约 (形状) -->
      <div id="u16" class="ax_文本" data-label="约">

        <!-- Unnamed () -->
        <div id="u17" class="text">
          <p><span>约</span></p>
        </div>
      </div>

      <div id="u18" class="ax_hot_spot" data-label="search热键">

      <div id="u19" class="ax_hot_spot">
      </div>
